	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			var entityPool entity.Pool
			err := json.Unmarshal([]byte(tt.fields.poolStr), &entityPool)
			assert.Nil(t, err)

			simulator, err := NewPoolSimulator(entityPool)
			assert.Nil(t, err)
			got, err := testutil.MustConcurrentSafe[*pool.CalcAmountInResult](t, func() (any, error) {
				return simulator.CalcAmountIn(tt.params)
			})
			if err != nil {
				assert.ErrorIsf(t, err, tt.wantErr, "PoolSimulator.CalcAmountIn() error = %v, wantErr %v", err, tt.wantErr)
				return
			}

			assert.Equalf(t, tt.want.TokenAmountIn.Token, got.TokenAmountIn.Token, "TokenAmountIn.Token = %v, want %v", got.TokenAmountIn.Token, tt.want.TokenAmountIn.Token)
			assert.Equalf(t, tt.want.TokenAmountIn.Amount, got.TokenAmountIn.Amount, "TokenAmountIn.Amount = %v, want %v", got.TokenAmountIn.Amount.String(), tt.want.TokenAmountIn.Amount.String())
			assert.Equalf(t, tt.want.Fee.Amount, got.Fee.Amount, "Fee.Amount = %v, want %v", got.Fee.Amount.String(), tt.want.Fee.Amount.String())
			assert.Equalf(t, tt.want.RemainingTokenAmountOut.Amount, got.RemainingTokenAmountOut.Amount, "Fee.Amount = %v, want %v", got.RemainingTokenAmountOut.Amount.String(), tt.want.RemainingTokenAmountOut.Amount.String())
		})
	}
